import React from 'react';
import {NavLink }  from 'react-router-dom';

const AdminSection = () => {
    const handleButton = () => {
        return console.log('click sur le boutton premiere lien amdinistrateur')
    }
    return (
        <div className="sidebar-admin">
            <ul className="administeur-menu">
                <li><NavLink to="/addDivision"><button type="button" onClick={handleButton}>Premier lien administrateur</button></NavLink> </li>
                <li>Premier lien administrateur </li>
                <li>Premier lien administrateur </li>
            </ul>
        </div>
    )
}

export default AdminSection;
